import React from 'react';
import './App.css';
import {Todolist} from "./Todolist";

function App() {
    const truck = "What to learn"
    const truck1 = "What to learn222"

    return (
        <div className="App">
            <Todolist truck={truck}/>
            <Todolist truck1={truck1}/>
        </div>
    );
}

export default App;
